    #         needed_mod = (prefix_sum - target_mod) % p
            
    #         if needed_mod in mod_map:
    #             min_len = min(min_len, i - mod_map[needed_mod])

    #         mod_map[prefix_sum] = i
        
    #     return min_len if min_len < len(nums) else -1


    def minSubarray(self, nums: List[int], p: int) -> int:

        summ = sum(nums)

        if p == 0 or summ // p == 0:
            return -1
        
        if summ % p == 0:
            return 0

        store_save = len(nums)

        for i in range(len(nums)):
            sub_sum = 0
            min_remove = 0

            for j in range(i, len(nums)):
                if min_remove == store_save:
                    break

                min_remove += 1
                sub_sum += nums[j]

                if (summ - sub_sum) % p == 0:
                    store_save = min(store_save, min_remove)
        
        return -1 if store_save == len(nums) else store_save



